"\ud83c\udf10 Dubai, UAE",a="YOUR CAR AUTO SERVICE is currently seeking a skilled and experienced Mechanic to join our team. As a Mechanic, you will be responsible for diagnosing, repairing, and maintaining a variety of vehicles to ensure their optimal performance and safety.\n\nResponsibilities:\n\nConduct routine maintenance tasks, including oil changes, tire rotations, and fluid checks.\nDiagnose mechanical issues using diagnostic equipment and tools.\nPerform repairs on engines, transmissions, brakes, and electrical systems.\nInterpret technical manuals and schematics to guide repair processes.\nCommunicate effectively with customers to explain repair procedures and provide recommendations for preventive maintenance.\nCollaborate with team members to prioritize tasks and meet deadlines.\nMaintain a clean and organized work environment.\nAdhere to safety protocols and regulations at all times.\n\nRequirements:\n\nProven experience as a mechanic, preferably [number of years] years.\nProficiency in using diagnostic equipment and tools.\nStrong understanding of automotive systems and components.\nExcellent troubleshooting skills.\nAbility to interpret technical manuals and schematics.\nGood communication and customer service skills.\nAttention to detail and a commitment to delivering high-quality workmanship.\n\nPreferred Qualifications:\n\nCertification from a recognized automotive training program.\nExperience working with a variety of vehicle makes and models.\nValid driver's license.( Optional)",a0="Automobile Mechanic",a1="Petit Forestier",a2="\u23f1 Temporary",a3="\ud83c\udf93 N/A",a4="We are currently seeking an experienced and skilled Automotive Mechanic for a temporary one-month position. This opportunity arises due to increased workload from recent inclement weather. As a mechanic, you will play a crucial role in ensuring the timely and efficient repair and maintenance of our clients' vehicles.\n\nResponsibilities:\n\nDiagnose and repair various mechanical and electrical issues in vehicles.\nPerform routine maintenance tasks, including oil changes, brake inspections, and tire rotations.\nUtilize diagnostic tools and equipment to troubleshoot and resolve vehicle problems.\nCommunicate effectively with team members and clients regarding repair needs and estimated completion times.\nMaintain a clean and organized workspace.\nEnsure all repairs and maintenance tasks are completed according to industry standards and safety protocols.\n\nQualifications:\n\nProven experience as an automotive mechanic.\nStrong understanding of automotive systems and diagnostics.\nProficiency with diagnostic tools and repair equipment.\nAbility to work efficiently and effectively under time constraints.\nStrong communication and customer service skills.\nValid driver's license.\n\nDuration:\n\nThis is a temporary position for one month.",a5="General Helper",a6="\ud83c\udf93  High-School / Secondary",a7="\ud83c\udf10 Dubai",a8="\ud83d\udcbc 0-1 Years",a9="Responsibilities:\n\nAssist with various tasks as directed by supervisors or team leaders.\nPerform general cleaning duties to maintain a tidy and safe work environment.\nHelp with the organization and arrangement of materials and equipment.\nSupport other team members in completing their tasks efficiently.\nFollow safety protocols and guidelines to prevent accidents or injuries.\nHandle basic maintenance tasks, such as replacing light bulbs or fixing minor equipment issues.\nPerform errands and deliveries as needed.\nOther duties as assigned.\n\nRequirements:\n\nAbility to follow instructions and work effectively in a team environment.\nPhysical stamina to perform manual labor tasks as required.\nBasic understanding of workplace safety practices.\nWillingness to learn and take on new responsibilities.\nHigh school diploma or equivalent preferred but not required.",b0="Document Controller",b1="Projeco Contracting",b2="\ud83c\udf10 Pearl Jumeirah, Dubai, UAE",b3="The preferred candidate should have at least three years of experience in the same role, for a construction company in the UAE.\n\nRole includes but is not limited to:\n\nPrinting and distributing documents as required.\nScan and upload documents according to company procedure.\nCollect and register all technical documents such as drawings and blueprints in the company\u2019s system.\nReview and update documents for maintenance and quality control.\nKeep other personnel updated on new document versions and how to obtain access.\n\nHandle records across various departments.\nCreate templates for use by other personnel.\nMaintain confidentiality regarding sensitive documents.\nEstablish and maintain record retention timelines.\nCopy, scan and store documents.\nCheck for accuracy and edit files, like contracts.\nReview and update technical documents (e.g. manuals and workflows).\n\nDistribute project-related copies to internal teams.\nFile documents in physical and digital records.\nCreate templates for future use.\nRetrieve files as requested by employees and clients.\nManage the flow of documentation within the organization.\nMaintain confidentiality around sensitive information and terms of agreement.\n\nPrepare ad-hoc reports on projects as needed.\nAuthorities NOC submission and tracking.\nWork permit application and tracking In addition prepare project submittals for consultant approval.\nCheck and update site files.",b4="Limousine Driver",b5="Super Ride Limousine L.L.C",b6="\u2328\ufe0e AED AED 2,000 - 3,999 per month",b7="\u23f1 Contract",b8="Responsibilities:\n\nSafely and efficiently transport clients or company personnel to various locations within Dubai and surrounding areas.\nMaintain the cleanliness and upkeep of the vehicle.\nAdhere to all traffic laws and regulations.\nEnsure timely arrivals and departures according to schedule.\n\nRequirements:\n\nValid UAE driver\u2019s license.\nProven 3 years experience as a driver, preferably in Dubai.\nFamiliarity with Dubai roads and traffic patterns.\nExcellent communication skills and customer service attitude.\nAbility to work flexible hours, including evenings and weekends.\nPreference will be given for Dubai RTA permit holders. The drivers must be professional posing all the essential qualities for the driven out in Dubai.\n\nBenefits:\nSalary: Negotiable\nNo Salary bar for the right candidate\nAccommodation will be provided by company.\nAs well as Health insurance.\n\nNote:\nIf Pakistani and Bangladeshi Applying, He must have the cancellation letter.",b9="Lady Driver",c0="Firstcall Human Resources Consultancy",c1="Perform daily pre and post-trip.\nMaintained family's vehicle cleanliness on a daily basis.\nDrove family's car to various city locations as assigned.\nPerformed vehicle maintenance such as refueling, oil changing, and other minor task.\nComply with all traffic laws and Family safety regulations.\nWilling to do other tasks aside from driving.\n\nQualifications\n\n- UAE driving license mandatory\n- Only looking or Female driver\n- Age should below 45\n- English proficiency must be Good\n- Arabic speaking is a plus.\n\nOnly qualified candidates will be contacted.",c2="Delivery Boy Job",c3="Five Tech International",c4="\u2328\ufe0e AED 4,000 - 5,999 per month",c5="\ud83c\udf93  N/A",c6="BIKE DRIVER JOB (RTA) GOVT COMP OF UAE\n\n\nDUBAI BIKE LICENSE PROVIDED BY COMPANY\n\n\nANY ONE CAN APPLY LICENSE HOLDERS OR WITHOUT LICENSE HOLDERS BOTH ELIGIBLE\n\nGUARANTEED MONTHLY INCOME 3200 TO 3700 DIRHAMS\n\nNEED 25 - 30 DAYS ON TO PROCESS YOUR EMPLOYMENT VISA\n\nAGE MINIMUM 21 to 47\n40% ENGLISH SPEAKING AND READING REQUIRED\n\n\nBENEFITS OF JOINING RTA\n\nWEEKLY 6 DAYS WORK\nDUTY 11 HOURS\nMEDICAL\nHEALTH INSURANCE\nACCIDENTAL INSURANCE\nPROVIDED BY COMPANY\nBIKE COMP\nUNIFORM COMP\nYEARLY 30 DAYS VACATION\n\n\nNO ADVANCE\nNO REGISTRATION FEES\nPAYMENT AFTER VISA\n\n\nINTERVIEW ADDRESS\nFivetech International\nBinsaugat bldg, 4th floor/401, Opp crown plaza hotel, before muraqqabat police station, nearest metro salaudin metro deira dubai.",c7="Delivery",c8="Amis Consulting",c9="\ud83c\udf10 Dubai Marina, Dubai, UAE",d0="Are you looking for a rewarding job opportunity in the food delivery industry? Look no further! We are currently hiring food delivery couriers for our team in Romania.\n\nJob Position: Food Delivery Courier\n\nLocation: Various cities across Romania\nEmployment Type: Full-time & Part-time available\nCompetitive Salary: Starting from 1000 euros per month\nStart Date: Immediate\n\nWhy Join Us\n\nFlexible Hours: Work according to your schedule\nCompetitive Pay: Earn a competitive salary with bonus incentives\nAccommodation Provided: We offer accommodation for our employees\nWork Permit & Visa Assistance: We handle work permit and visa processing for international applicants\n\nAbout the Role:\n\nAs a food delivery courier, you will be responsible for delivering food orders to customers in a timely and efficient manner. You will work closely with restaurants and customers to ensure a seamless delivery experience.\n\nRequirements:\n\nAbility to work independently\nPositive attitude\n\nHow to Apply:\n\nIf you're ready to join our dynamic team and embark on an exciting career journey, apply now!\n\n\nDon't miss out on this incredible opportunity to work and live in Romania while enjoying a fulfilling career in the food delivery industry! Apply today and start your adventure with us.",d1="Civil Engineer",d2="FRH Project Management Services Co. LLC.",d3="\u2328\ufe0e AED 6,000 - 7,999 per month",d4="Basic understanding of all drawings\nQuality supervision as per drawing\nMaterial procurement\nUnderstanding of construction materials\nQuality supervision\nLabor control\nSupervise all construction activities on a construction site\nConduct work conference with workers, sub-contractor and other personnel\nFit out & MEP Experience\n\nREQUIREMENTS:\n3 - 5 years working experience in UAE\nWith valid UAE driver's license\nBachelor Civil / Interior Designer\nFully versed in Autocad / MS Excel",d5="Project Engineer",d6="AMZAN MIDDLE EAST LLC",d7="Negotiable",d8="\ud83c\udf10 Al Quoz Industrial Area 1",d9="Required Indian Project Engineer for a leading Architectural metal & fit-out works company in Dubai. Minimum 4 years experience in the metal or fit out fields. The Person should have good command over written and spoken English.",e0="HR Admin",e1="MBM Digital",e2="Responsibilities:\n\nMaintain employee records, including onboarding, offboarding, and personnel files.\nManage HR databases and ensure data accuracy and integrity.\nCoordinate employee benefits, such as health insurance and retirement plans.\nAssist in recruitment efforts by posting job openings, screening resumes, and scheduling interviews.\nHandle employee inquiries regarding HR policies, benefits, and procedures.\nProcess payroll and ensure timely and accurate payments.\nAdminister performance evaluation processes and track employee attendance.\nAssist in HR projects and initiatives as needed.\n\nRequirements:\n\nProven experience as an HR Administrator or similar role.\nFamiliarity with HR software and databases.\nStrong organizational and multitasking skills.\nExcellent communication and interpersonal abilities.\nAttention to detail and discretion when handling confidential information.",e3="HR Assistant",e4="\ud83c\udf10 Al Garhoud, Dubai, UAE",e5="Job Responsibilities:\n\nSupport\nOnboarding and Orientation\nEmployee Relations\nHR Administration\nTraining and Development\nCompliance and Reporting\n\nBenefits:\nMedical insurance\nVisa Sponsorship\nPlus other benefits as per the UAE labor law\n\nCandidates who can join immediately",e6="Pastry Chef",e7="Freshdaily Bakery Products And Manufacturing LLC",e8="Responsible for the creation, decoration, and presentation of desserts such as cakes , cookies , brownies , cheesecakes cupcakes, and other sweet pastries.\n\nSkills Proven work experience as a Pastry Chef or cook, and baking and pastry making Advanced knowledge of culinary, baking and pastry techniques\n\nAbility to remain calm and undertake various tasks Excellent time management abilities Up-to-date knowledge of baking techniques and recipes\n\nMeasure, Assemble & Prepare the ingredients as per the Recipe.\n\nProperly store food items at appropriate temperature.\n\nMaintain accurate food inventory. Ensure that the food prep area and kitchen are cleaned and sanitize at the end of the shift.\n\nEnsure the consistency of the products. Can work with minimum supervision.\n\nRespect all staff regardless of position and background!!\n\nFull Job Description\n\nAble to bake cakes, cookies ,cheesecakes ,\nable to decorate cakes\n\nReport events on the daily program to ensure that team are aware of incoming large orders in the bakery\n\nResponsible for the overall running and operation of the Pastry and Bakery area.\n\nMotivate the team and ensure that full instructions are given on a daily basis.\nensure that the presentation, taste, texture and quantity are maintained to the standards laid by the owner.\n\nCome up with new desert ideas.\n\nEnsure that the whole team is familiar with the menu and to be adaptable with continual changes to ensure that the menu is kept in line with customer demands.\n\nBe responsible for ordering any stock required of your department.",e9="Assistant chef",f0="\u2328\ufe0e AED 0 - 1,999 per month",f1="Assistant chef required to work in restaurant accommodation and transportation and visa free",f2="Mobile App Developer",f3="Misa International",f4="\ud83c\udf93  Bachelors Degree",f5="MISA International is a leading technology company dedicated to creating innovative solutions that enhance user experiences and streamline operations. We are committed to pushing the boundaries of technology and delivering exceptional value to our clients and customers.\n\nWe are seeking a talented and experienced Mobile App Developer to join our dynamic team to design, development, and maintenance of high-quality mobile applications for Android and iOS platforms.\n\nKey Responsibilities:\n\nLead the development team in defining project requirements, architecture, and technical specifications.\nDesign and develop complex mobile applications for Android and iOS platforms using native languages (e.g., Java/Kotlin for Android, Swift for iOS) or cross-platform frameworks (e.g., React Native, Flutter).\nImplement advanced features and functionality based on project requirements and design specifications.\nEnsure the performance, scalability, and security of mobile applications through thorough testing and optimization.\nStay up-to-date with the latest trends and advancements in mobile technology and share knowledge with the team.\n\nRequirements:\n\nBachelor's degree in Computer Science, Computer Engineering, or a related field.\nMinimum of 3-5 years of experience as a Mobile App Developer, with a strong portfolio of mobile applications developed for Android and/or iOS platforms.\nProficiency in programming languages and frameworks relevant to mobile app development, such as Java, Kotlin, Swift, React Native, or Flutter.\nSolid understanding of mobile app architecture, design patterns, and best practices.\nExperience with Android Studio and Xcode for mobile app development.\nExperience with version control systems (e.g., Git) and agile development methodologies.\nStrong problem-solving skills and attention to detail.\nExcellent communication and leadership skills.\nAbility to work independently and in a team environment.\nA passion for learning and staying updated on emerging technologies and industry trends.",f6="Software consultant",f7="DLI Systems",f8="Responsible for converting business requirement into system implementation.\nParticipate in the design, implementation, and support of business solutions.\nResponsible for gathering requirements, performing analysis/design, testing, documentation.\n\nUser training to maintain and improve overall Information Systems performance.\nSupport implementation and production issues in Human Capital Management.\nIdentify functionality gaps and provide solutions.\n\nWrite function design documents for reports, interfaces, data conversions and application extensions.\n\nSupport business users with the execution of test scripts.\nEffectively communicate and drive project deliverables.\nProvide status and issue reports to the project manager/key stakeholders on a regular basis.\n\nTo work in collaboration with development team for providing client support.\nTo work independently on projects and production support with minimum supervision.\nArabic speaking preferred."
